import "./App.css";
import Home from "./components/Home";
import Profile from "./components/Profile";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <>
    <BrowserRouter>
       <Switch>
          <Route path="Home">
            <Home />
          </Route>
          
        </Switch>
        </BrowserRouter>

      {/* <Home Home={Home} />
      <Profile Profile={Profile} /> */}
    </>
  );
}

export default App;
